import React from 'react';
import { NavLink } from 'react-router-dom';
import Button from "../components/Button";

const Navigation = () => {
    return (
        <div>
            <Button/>
            <NavLink to="/login"><button type="button">
                Login
            </button></NavLink>
            <NavLink to="/signUp">SignUp</NavLink>
        </div>
    );
}

export default Navigation;
